// client/src/components/MitigationForm.js
import React, { useState } from "react";
import { getRoomSummary, getPsychTable, getFinalSummary } from "../api";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    customerName: "",
    jobAddress: "",
    jobType: "",
    paymentStatus: "",
    insuranceWait: "",
  });

  const [rooms, setRooms] = useState([{ roomName: "", moistureReadings: "" }]);
  const [psychTable, setPsychTable] = useState("");
  const [finalSummary, setFinalSummary] = useState("");

  // Input handling
  const handleInput = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Room updates
  const handleRoomChange = (index, e) => {
    const newRooms = [...rooms];
    newRooms[index][e.target.name] = e.target.value;
    setRooms(newRooms);
  };

  const addRoom = () => {
    setRooms([...rooms, { roomName: "", moistureReadings: "" }]);
  };

  // AI Calls
  const generateRoomSummary = async (index) => {
    const res = await getRoomSummary(rooms[index]);
    alert("AI Generated Room Summary:\n\n" + res.summary);
  };

  const generatePsychTable = async () => {
    const res = await getPsychTable({
      jobType: formData.jobType,
      moistureReadings: rooms.map(r => r.moistureReadings).join(", "),
    });
    setPsychTable(res.table);
    alert("AI Psychrometric Table Created!");
  };

  const generateFinalSummary = async () => {
    const res = await getFinalSummary({
      ...formData,
      rooms,
      psychTable,
    });
    setFinalSummary(res.finalReport);
    alert("AI Final Insurance Summary Created!");
  };

  return (
    <div className="container">
      <h1>üß∞ ToolbeltAI Mitigation Daily Log</h1>

      {/* Job Info */}
      <section>
        <h3>üìå Job Information</h3>
        <input name="customerName" placeholder="Customer Name" onChange={handleInput} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleInput} />

        <select name="jobType" onChange={handleInput}>
          <option value="">Select Job Type</option>
          <option>Water Damage</option>
          <option>Fire Damage</option>
          <option>Mold Remediation</option>
        </select>

        <select name="paymentStatus" onChange={handleInput}>
          <option value="">Select Payment Status</option>
          <option>Customer Paid</option>
          <option>Waiting on Insurance</option>
          <option>Finance Plan</option>
        </select>
      </section>

      {/* Rooms */}
      <section>
        <h3>üè† Rooms & Readings</h3>
        {rooms.map((room, i) => (
          <div key={i}>
            <input
              name="roomName"
              placeholder="Room Name"
              value={room.roomName}
              onChange={(e) => handleRoomChange(i, e)}
            />
            <input
              name="moistureReadings"
              placeholder="Moisture Readings"
              value={room.moistureReadings}
              onChange={(e) => handleRoomChange(i, e)}
            />
            <button onClick={() => generateRoomSummary(i)}>‚öôÔ∏è Generate AI Summary</button>
          </div>
        ))}
        <button onClick={addRoom}>‚ûï Add Another Room</button>
      </section>

      {/* Psychrometric Table */}
      <section>
        <h3>üìä Psychrometric Table</h3>
        <button onClick={generatePsychTable}>‚öôÔ∏è Generate Psych Table</button>
        <textarea value={psychTable} readOnly rows={5} />
      </section>

      {/* Final Summary */}
      <section>
        <h3>üìú Final Insurance Summary</h3>
        <button onClick={generateFinalSummary}>‚öôÔ∏è Generate Final Summary</button>
        <textarea value={finalSummary} readOnly rows={8} />
      </section>
    </div>
  );
};

export default MitigationForm;
